import React from 'react';
import { useAllNotes } from '../contexts/notes';
import NoteBox from '../components/NoteBox/NoteBox';
import CreateNote from '../components/CreateNote/CreateNote';
import { Link } from "react-router-dom";

const Home: React.FC = () => {
    const { notes, addNote } = useAllNotes();

    return (
        <div>
            <div className={`py-4 mx-2 text-black menu-item text-xl hover:font-bold`}>
                <Link to={"/secondhome"}>Importante notes</Link>
            </div>
            <CreateNote />
            <h1>Notes</h1>
            <ul>
                {notes.map((note) => (
                    <NoteBox note={note}></NoteBox>
                ))}
            </ul>
        </div>
    );
};

export default Home;
